import React, { Component } from 'react';

class PhotoSet extends Component {
  render() {
    const link = this.props.photoset;

    return (
      <NavLink
        to={`/${link.page}`}
        exact

        id={link.name}
        className='PhotoSet'
      >
        {link.page}
        <img
          src={link.image}
          alt={link.page}
        />
      </NavLink>
    )
  }
}

export default PhotoSet;
